import styled from 'styled-components';
export const Div0 = styled.div`
    width: 100%;
    margin: 0 auto;
    height:100%;
    min-width: 1200px;
    display:grid;
    grid-template-columns:1fr 1fr 1fr 1fr;
    grid-gap:20px;

`
export const DataInfoItem = styled.div`
    background-color:white;
    border:gray 2px solid;
    border-radius:20px;
    display:grid;
    grid-template-rows:1fr 1fr 1fr;
    grid-gap:10px;
`
export const Div3 =styled.div`
    font-size:20px;
    font-family: 'Noto Sans TC', sans-serif;
    padding-left: 20px;
    padding-top: 10px;
    width:100%;
    
`
export const DivDetail1 =styled.div`
    font-size:20px;
    font-family: 'Noto Sans TC', sans-serif;
    float:left;
`
export const DivDetail2 =styled.div`
    font-size:20px;
    font-family: 'Noto Sans TC', sans-serif;
    float:right;
`
